function TestComponent({ utilities, savedUserSettings, onSavedUserSettingsChange }) {
  const [data, setData] = useState([]);
  const [total, setTotal] = useState(0);

  useEffect(() => {
    async function loadData() {
      const result = await utilities.rv.RunView({
        EntityName: 'Accounts',
        MaxRows: 100
      });
      if (result.Success) {
        setData(result.Results || []);
        // Dangerous: reduce without initial value will throw on empty array
        const sum = result.Results.reduce((acc, item) => acc + item.Amount);
        setTotal(sum);
      }
    }
    loadData();
  }, []);

  return (
    <div>
      <h1>Total: {total}</h1>
      <p>Items: {data.length}</p>
    </div>
  );
}
